import * as React from 'react';
import { MDBCard, MDBCardBody, MDBCardImage } from 'mdb-react-ui-kit';


//get last searches from local storage
function getLastSearches() {
    const lastSearches = localStorage.getItem('lastSearches');
    if (lastSearches) {
        return JSON.parse(lastSearches);
    } else {
        return [];
    }
}

function SideBar() {

    return (
        <MDBCard>
            <MDBCardBody>Last searches</MDBCardBody>
            <MDBCardBody>A</MDBCardBody>
            <MDBCardBody>B</MDBCardBody>
            <MDBCardBody>C</MDBCardBody>
            <MDBCardBody>D</MDBCardBody>
            <MDBCardBody>E</MDBCardBody>
            {/* <MDBCardImage src='https://mdbootstrap.com/img/new/standard/nature/184.webp' position='top' alt='...' /> */}
        </MDBCard>
    );
}
export default SideBar;
